import { createSlice } from "@reduxjs/toolkit";

export const userSlice = createSlice({
  name: "users",
  initialState: {
    value: {
      reservations: [
        {
          id: 111,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 222,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 333,
          reserved: true,
          whoreservet: "Andrius",
          selected: false,
        },
        {
          id: 444,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 555,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 666,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 777,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 888,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
        {
          id: 999,
          reserved: false,
          whoreservet: "",
          selected: false,
        },
      ],
    },
  },
  reducers: {
    changeName: (state, action) => {
      state.value.username = action.payload;
    },
  },
});
export const { changeName, changePicture, addUser, updateArr } =
  userSlice.actions;

export default userSlice.reducer;
